  false,\n\t\"url\": null,\n\t\"notes\": \"A total of 294 commercial fishers, randomly
  selected from a population possessing an active Florida Saltwater Products license,
  provided information on their fishing activities within and outside the Florida
  Keys National Marine Sanctuary, including their use around the no-take zones within
  the Sanctuary. The fishers also provided socio-demographic, economic, and perceptions
  data, which served to compare their performance in and views concerning the Sanctuary
  and its regulations.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
